//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// give the contract some SVG code
// output an NFT URI with this svg code
// Storing all the nft metadata on chain
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "base64-sol/base64.sol";

contract SVGNFT is ERC721URIStorage {
	uint256 public tokenCounter;
	event CreatedSVGNFT(uint256 indexed tokenId, string tokenURI);

	constructor() ERC721("SVG NFT", "svgNFT") {
		tokenCounter = 0;
	}

	mapping(address => string) public uriOwner;

	function create(string memory _svg) public {
			_safeMint(msg.sender, tokenCounter);
			// imageUri?
			string memory imageURI = svgToImageURI(_svg);
			// tokenUri?
			string memory tokenURI = formatTokenURI(imageURI);
			_setTokenURI(tokenCounter, tokenURI);
			emit CreatedSVGNFT(tokenCounter, tokenURI);
			tokenCounter++;
	}

	function svgToImageURI(string memory _svg) public pure returns (string memory){
		// <svg xmlns="http://www.w3.org/2000/svg" height="210" width="400"> <path d="M150 0 L75 200 L225 200 Z" /></svg>
		// data:image/svg+xml;base64,<Base64-encodingL>
		// create the base url
		string memory baseURL = "data:image/svg+xml;base64,";
		// Encode it into Base64
		string memory svgBase64Encoded = Base64.encode(bytes(string(abi.encodePacked(_svg))));
		// concat the base and encoded svg into image uri
		string memory imageURI = string(abi.encodePacked(baseURL, svgBase64Encoded));
		return imageURI;
	}

	function transferer(address _from, address _to, uint _tokenId) public {
		_safeTransfer(_from, _to, _tokenId, "");
	}

	function formatTokenURI(string memory _imageURI) public pure returns (string memory) {
		return string(
                abi.encodePacked("data:application/json;base64,", Base64.encode(
                        bytes(
                            abi.encodePacked(
                                '{"name":"',
                                "SVG NFT", // You can add whatever name here
                                '", "description":"An NFT based on SVG!", "attributes":"", "image":"',_imageURI,'"}'
                    )))));
	}
}
